import unittest
import big_test_case


from maximize_the_profit_as_a_salesman import Solution

class TestSolution(unittest.TestCase):


    def test_1(self):
        n = 5
        offers = [[0,0,1],[0,2,2],[1,3,2]]
        s = Solution()
        result = s.maximizeTheProfit(n, offers)
        self.assertEqual(3, result)

    def test_2(self):
        n = 5
        offers = [[0,0,1],[0,2,10],[1,3,2]]
        s = Solution()
        result = s.maximizeTheProfit(n, offers)
        self.assertEqual(10, result)

    def test_4(self):
        n = 10
        offers = [[0, 5, 1], [1, 3, 4], [6, 6, 1]] 
        s = Solution()
        result = s.maximizeTheProfit(n, offers)
        self.assertEqual(5, result)

    def test_5(self):
        n = 4
        offers = [[0,0,5],[3,3,1],[1,2,5],[0,0,7]]
        s = Solution()
        result = s.maximizeTheProfit(n, offers)
        self.assertEqual(13, result)

    def test_6(self):
        n = 9
        offers = [[1,6,2],[1,6,4],[1,7,9],[5,7,10],[0,8,3]]
        s = Solution()
        result = s.maximizeTheProfit(n, offers)
        self.assertEqual(10, result)

